// src/pages/Dashboard.jsx
import useAuth from '../contexts/useAuth';

const Dashboard = () => {
  const { user, logout } = useAuth();

  return (
    <div className="max-w-7xl mx-auto py-20 px-6">
      <h1 className="text-4xl font-bold mb-8">Welcome to Your Dashboard, {user?.name || 'User'}!</h1>
      <p className="text-xl mb-6">This is a protected page. You're logged in!</p>
      <button
        onClick={logout}
        className="px-6 py-3 bg-red-600 text-white rounded-full font-medium"
      >
        Logout
      </button>
    </div>
  );
};

export default Dashboard;
